I know theirs a lot of none optimal choices here, particularly in the extra deck

This is my Gozaburo Kaiba Anime Themed Character Deck. Gozaburo Kaiba is the crazy stepfather of Seto Kaiba. In the Virtual World Arc in season 3 of Yugioh Duel Monsters Gozaburo and Kaiba had a legendary grudge match and Gozaburo used a Exodia Necross Deck combined with elements from his Chess piece match against Kaiba. Gozaburo full deck wasn't shown, he only played a few cards so i used my own creativity and pulled from the new Exodia Support Yugioh Set Legendary Decks 2 to help build the deck. My anime themed character decks are NOT meant for Yugioh Official Tournament play, fun play only. The link below shows the legendary duel between Gozaburo Kaiba and Seto Kaiba so you can see why Gozaburo Kaiba's deck is built the way it is.

https://www.youtube.com/watch?v=1I7yu-B2_Bw&amp;t=75s

&nbsp;

So This is in the playtest Strategies I have 3 combos but im still working on it so this is v0.1.5

